import dotenv from 'dotenv'
import ejs from 'ejs'
import { mkdir, readFile, writeFile } from 'node:fs/promises'
import { basename, extname, resolve } from 'node:path'
import { cancel, run, status } from './utils/http'
import { base64ToImage, mimeToExtension, parseBase64Image } from './utils/b64-to-image'
import { imageToBase64 } from './utils/image-to-b64'
import type { Image, ImageProps } from '../types/index'

dotenv.config()

const workflowPaths = {
  1: resolve('workflows/qwen-image-edit-2509-fp8/single-image.json'),
  2: resolve('workflows/qwen-image-edit-2509-fp8/dual-images.json'),
  3: resolve('workflows/qwen-image-edit-2509-fp8/triple-images.json'),
} as const

type Options = {
  imagePaths: string[]
  positivePrompt: string
  negativePrompt: string
  steps: number
  cfg: number
  outputDir: string
}

const getNumber = (value: string | undefined) => {
  if (!value) return undefined
  const parsed = Number(value)
  return Number.isFinite(parsed) ? parsed : undefined
}

const loadWorkflow = async (options: ImageProps) => {
  const workflowPath = workflowPaths[options.images.length as 1 | 2 | 3]
  const template = await readFile(workflowPath, 'utf8')
  const rendered = ejs.render(template, {
    images: options.images,
    positivePrompt: options.positivePrompt,
    negativePrompt: options.negativePrompt,
    steps: options.steps,
    cfg: options.cfg,
    diffusionModel: options.diffusionModel,
  })

  return JSON.parse(rendered)
}

const coerceImagesFromMessage = (message: string) => {
  const trimmed = message.trim()
  if (!trimmed) return []
  if (trimmed.startsWith('{') || trimmed.startsWith('[')) {
    try {
      const parsed = JSON.parse(trimmed)
      const output = parsed?.output ?? parsed
      if (Array.isArray(output?.images)) return output.images
      if (Array.isArray(output)) return output
    } catch {
      return []
    }
  }
  if (trimmed.startsWith('data:image/') || trimmed.length > 1024) {
    return [{ image: trimmed }]
  }
  return []
}

const extractImages = (payload: any) => {
  const output = payload?.output ?? payload
  if (Array.isArray(output?.images)) return output.images
  if (Array.isArray(output)) return output
  const message = output?.message
  if (typeof message === 'string') return coerceImagesFromMessage(message)
  return []
}

const buildOutputName = (baseName: string, index: number, image: string, providedName?: string) => {
  const name = providedName ?? `${baseName}-${index + 1}`
  if (extname(name)) return name
  const { mime } = parseBase64Image(image)
  const ext = mimeToExtension(mime) ?? 'png'
  return `${name}.${ext}`
}

const parseArgs = (argv: string[]) => {
  const options: Options = {
    imagePaths: [],
    positivePrompt: '',
    negativePrompt: '',
    steps: 20,
    cfg: 10,
    outputDir: 'output',
  }

  for (let index = 0; index < argv.length; index += 1) {
    const arg = argv[index]
    if (arg === '-pp') {
      options.positivePrompt = argv[index + 1] ?? ''
      index += 1
      continue
    }
    if (arg === '-np') {
      options.negativePrompt = argv[index + 1] ?? ''
      index += 1
      continue
    }
    if (arg === '-s') {
      const parsed = getNumber(argv[index + 1])
      if (typeof parsed === 'number') options.steps = parsed
      index += 1
      continue
    }
    if (arg === '-c') {
      const parsed = getNumber(argv[index + 1])
      if (typeof parsed === 'number') options.cfg = parsed
      index += 1
      continue
    }
    if (arg === '-o') {
      options.outputDir = argv[index + 1] ?? options.outputDir
      index += 1
      continue
    }
    if (arg.startsWith('-')) {
      throw new Error(`Unknown option: ${arg}`)
    }
    if (options.imagePaths.length < 3) {
      options.imagePaths.push(arg)
    }
  }

  if (options.imagePaths.length === 0) {
    throw new Error(
      'Missing image path. Usage: npm run fire -- <image-path>... [-pp <positive-prompt>] [-np <negative-prompt>] [-s <steps>] [-c <cfg>] [-o <output-dir>]'
    )
  }

  return options
}

const logResponse = async (method: string, res: unknown) => {
  const logDir = resolve('.log')
  await mkdir(logDir, { recursive: true })
  const time = new Date().toISOString()
  const fileName = time.replace(/[:.]/g, '-') + '.json'
  const payload = { time, method, res }
  await writeFile(resolve(logDir, fileName), JSON.stringify(payload, null, 2))
}

const delay = (ms: number) => new Promise((resolveTimeout) => setTimeout(resolveTimeout, ms))

const waitForCompletion = async (jobId: string) => {
  const pollIntervalMs = 2000
  const maxAttempts = 120
  for (let attempt = 0; attempt < maxAttempts; attempt += 1) {
    const response = await status(jobId)
    const data = response.data
    await logResponse('status', data)
    if (data?.status === 'COMPLETED' || data?.status === 'FAILED') {
      return data
    }
    await delay(pollIntervalMs)
  }
  throw new Error(`Polling status timed out after ${maxAttempts} attempts.`)
}

const main = async () => {
  const options = parseArgs(process.argv.slice(2))

  const images: Image[] = await Promise.all(
    options.imagePaths.map(async (imagePath) => ({
      name: basename(imagePath),
      image: await imageToBase64(imagePath),
    }))
  )
  const payload = await loadWorkflow({
    images,
    positivePrompt: options.positivePrompt,
    negativePrompt: options.negativePrompt,
    steps: options.steps,
    cfg: options.cfg,
    diffusionModel: 'qwen_image_edit_fp8_e4m3fn.safetensors'
  })

  const runResponse = await run(payload)
  const runData = runResponse.data
  await logResponse('run', runData)
  const jobId = runData?.id
  if (!jobId) {
    throw new Error('Serverless request did not return a job id.')
  }

  const statusData = await waitForCompletion(jobId)
  if (statusData?.status === 'FAILED') {
    throw new Error(statusData?.error ?? 'Serverless request failed.')
  }

  const outputImages = extractImages(statusData)
  const baseName = basename(images[0]?.name ?? 'image', extname(images[0]?.name ?? 'image'))
  const outputDir = resolve(options.outputDir)

  const written: string[] = []
  for (const [index, item] of outputImages.entries()) {
    const imageData = typeof item === 'string' ? item : item?.image ?? item?.data
    if (!imageData) continue
    const outputName = buildOutputName(baseName, index, imageData, item?.filename ?? item?.name)
    const outputPath = resolve(outputDir, outputName)
    await base64ToImage(imageData, outputPath)
    written.push(outputPath)
  }

  console.log(JSON.stringify({ ...statusData, saved: written }, null, 2))
}

